import React from 'react';
import { Menubar } from 'primereact/menubar';
import { Card } from 'react-bootstrap';

function Formations() {
  const items = [
    {
      label: 'Formations',
      icon: 'pi pi-fw pi-book',
    },
    {
      label: 'Experiences',
      icon: 'pi pi-fw pi-briefcase',
    },
    {
      label: 'Projects',
      icon: 'pi pi-fw pi-desktop',
    },
    {
      label: 'Certifications',
      icon: 'pi pi-fw pi-certificate',
    },
    {
      label: 'Contact',
      icon: 'pi pi-fw pi-envelope',
    },
  ];

  const start = <img alt="logo" src="showcase/images/logo.png" height="40" className="p-mr-2" />;
  const end = (
    <input
      type="text"
      placeholder="Search"
      className="p-inputtext p-component"
      style={{ width: '300px' }}
    />
  );

  return (
    <div>
      <Menubar model={items} start={start} end={end} />

      <section className="section">
        {Formations.map((formation) => (
          <Card key={formation.diplome} className="mb-3">
            <Card.Body>
              <Card.Title>{formation.diplome}</Card.Title>
              <Card.Subtitle className="mb-2 text-muted">{formation.etablissement}</Card.Subtitle>
              <Card.Text>{formation.annees}</Card.Text>
            </Card.Body>
          </Card>
        ))}
      </section>
    </div>
  );
}

export default Formations;
